// src/toolset.ts
var GithubToolset = class extends OpenAPIToolset {
  name = "GITHUB";
  logoUrl = "";
  config;
  tools;
  categories = ["dev-tools"];
  description = "GitHub is a development platform inspired by the way you work. From open source to business, you can host and review code, manage projects, and build software alongside millions of other developers.";
  constructor({ config }) {
    super();
    this.config = config;
    this.tools = this._generateIntegrationTools();
  }
  get toolSchemas() {
    return zodSchema_exports;
  }
  get toolDocumentations() {
    return comments;
  }
  get baseClient() {
    client.setConfig({
      baseUrl: `https://api.github.com`
    });
    return services_gen_exports;
  }
  getApiClient = async () => {
    const value = {
      PERSONAL_ACCESS_TOKEN: this.config?.["PERSONAL_ACCESS_TOKEN"]
    };
    const baseClient = this.baseClient;
    baseClient.client.interceptors.request.use((request) => {
      request.headers.set("Authorization", `Bearer ${value?.["PERSONAL_ACCESS_TOKEN"]}`);
      return request;
    });
    return services_gen_exports;
  };
};

// src/index.ts
var GithubIntegration = class extends Integration {
  name = "GITHUB";
  logoUrl = "";
  config;
  categories = ["dev-tools"];
  description = "GitHub is a development platform inspired by the way you work. From open source to business, you can host and review code, manage projects, and build software alongside millions of other developers.";
  openapi;
  constructor({ config }) {
    super();
    this.config = config;
    this.openapi = new GithubToolset({
      config: this.config
    });
  }
  getStaticTools() {
    return this.openapi.tools;
  }
  async getApiClient() {
    return this.openapi.getApiClient();
  }
};

export { GithubIntegration };
